import React from 'react';
import {Component} from 'react';
import Pictures from "./Pictures"
import './App.css';
import { entries } from './EntriesData.js'
import { Navbar, NavDropdown, MenuItem, FormControl, Button } from 'react-bootstrap';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
  constructor() {
    super();
    this.state = {
      entries: entries
    }
  }
  componentDidMount(){

    var self = this;
    // self.setState({
    //   entries: entries
    // });
  }
  render(){
    return (

          <Router>
          <div>

            <ul>
              <li>
                <Link to="/public">Public Page</Link>
              </li>
              <li>
                <Link to="/protected">Protected Page</Link>
              </li>
            </ul>

            <Switch>
              <Route path="/public">
                <PublicPage />
              </Route>
              <Route path="/protected">
                <ProtectedPage />
              </Route>
            </Switch>
          </div>
        </Router>
    );
  }
}
export default App;

function PublicPage() {
  return <div className="App">
  <header className="App-header">
    <section className = "Welcome-text">
      <h1><strong>Hey, I'm Noah Saldaña</strong></h1>
        <section className = "Welcome-sub">
          <p>iOS Developer - Student Mentor - Human-Centered Designer</p>
        </section>
    </section>
    <section id = "Recipes">

      {entries.map((entry)=>(
        <Pictures
        key = {entry.name}
        name = {entry.name}
        link = {entry.link}
        description = {entry.description}
        />
      ))}
    </section>
  </header>
  </div>;
}

function ProtectedPage() {
  return <Navbar bg='light' expand='lg'>
  <Navbar.Brand href="#home">Menu</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className='mr-auto'>
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#link">Link</Nav.Link>
      <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
}
